import React from "react";
import styled from "styled-components";

const Wrapper = styled.div`
  height: 80px;
  background-color: #ccc;
  width: 940px;
  display: flex;
`;

export default function Header() {
  return (
    <div style="margin: auto">
      <Wrapper>Header height 80px</Wrapper>
    </div>
  );
}
